import React from 'react'
import { withStyles } from "@material-ui/styles";

const styles = {
  root: {
    background: "grey",
    border: "1px solid yellow",
    padding: "16px",
    display: "flex",
    flexDirection: "column",
    alignItems: "center"
  },
  avatarContainer: {
    width: "40px",
    height: "40px",
    borderRadius: "50%",
    background: "white",
    display: "flex",
    alignItems: "center",
    justifyContent: "center",
    overflow: "hidden"
  },
  info: {
    border: "1px solid blue",
    marginTop: "16px",
    "& p": {
      margin: "0px",
      textAlign: "center"
    }
  }
}

function TeamMember(props) {
  const { classes } = props;
  return (
    <a href="https://www.linkedin.com/in/chenghan-ke/">

      <div className={classes.root}>


        <div className={classes.avatarContainer}>img</div>
        <div className={classes.info}>
          <p>Sam Li</p>
          <p>Senior Product Manager</p>
        </div>


      </div>
    </a>


  )
}

export default withStyles(styles)(TeamMember);
